"use strict";

const create = require("./wasm-hash");

//#region wasm code: md4 (../../../assembly/hash/md4.asm.ts) --initialMemory 1
const md4 = new WebAssembly.Module(
	Buffer.from(
		// 2154 bytes
		"",
		"base64"
	)
);
//#endregion

module.exports = create.bind(null, md4, [], 64, 32);
